pub enum Payload {

    /// ID protocol address.
    ID(u64),

    /// SECP256K1 key address, 20 byte hash of PublicKey
    Secp256k1([u8; ]),

    /// Actor protocol address, 20 byte hash of actor data
    Actor([u8; ]),

    /// BLS key address, full 48 byte public key
    BLS(BLSPublicKey),
}

